"premium_learn_more_safe_wifi_description" : "Proteja seus dados pessoais contra redes Wi-Fi inseguras. 

• Receba alertas ao acessar uma rede Wi-Fi comprometida; 
• Instruções passo a passo para desconectar-se de uma rede Wi-Fi insegura."

"security_wifi_upsell_item_alerts" : "O Wi-Fi Seguro ajuda a evitar que invasores acessem seus dados pessoais, como: 

• Dados pessoais financeiros; 
• E-mails e mensagens de texto SMS; 
• Senhas de contas."
